<?phpnamespace Nemundo\Meteo\Sat24\Data\LatestContent;class LatestContentPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var LatestContentModel*/public $model;public function __construct() {parent::__construct();$this->model = new LatestContentModel();}/*** @return LatestContentRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new LatestContentRow($dataRow, $this->model);$list[] = $row;}return $list;}}